import React,{useRef} from 'react'

export default function Start({setName}) {
    const inputr= useRef();
    function handleChange(){
        setName(inputr.current.value);
    }
    return (
        <div className = "start">
            <input className="inputStart" type="text" placeholder="Enter your name"  
            ref = {inputr} />
            <button className="btnStart" onClick={handleChange} >START</button>
        </div>
    )
}
